import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';
import {ReqctiveFormsModule, ReactiveFormsModule} from '@angular/forms');
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { IngredientComponent } from './component/ingredient/ingredient.component';
import { HttpClientModule } from '@angular/common/http';
import { IngredientFormComponent } from './component/ingredient-form/ingredient-form.component';

@NgModule({
  declarations: [
    AppComponent,
    IngredientComponent,
    IngredientFormComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule, 
    FormsModule,
    ReqctiveFormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
